// src/components/BikeCard.js
import React from 'react';
import '.styles/bikeCard.css';

const BikeCard = ({ bike }) => {
  return (
    <div className="card">
      {/* Display the image using the imageUrl from the bike object */}
      <img src={`/assets/images/bikes/${bike.img_url}`} alt={bike.model} />
      <h3>{bike.model}</h3>
      <p>{bike.manufacturer}</p>
      <p className="price">{bike.price}</p>
    </div>
  );
};

export default BikeCard;
